import React,{ Component } from 'react';
import { Link } from 'react-router-dom';
import gdsicon from './../img/gdsicon.png';
class Singin extends Component {
    render() {
        return(
            <div className="wrap"><div className="container">
                <div className="singin">
                    <div className="title">
                        <p className="text-center">GDS Agent App</p>
                    </div>
                    <div className="form-content">
                        <div className="logo">
                            <img src={gdsicon} alt="GDS"/>
                            <img src="" alt=""/>
                        </div>
                        <div className="form">
                            <div className="login-icon text-center">
                                <img src={dchannel} alt="dchannel"/>
                            </div>
                            <input type="text" name="" placeholder="Phone No" required=""></input>
                            <input type="password" name="" placeholder="Password" require   d=""></input>
                            <button className="btn-com"><Link to="/dashboard" className="cl-white" value="dashboard">SIGN IN</Link></button>
                            <button className="btn-com"><Link to="/register" className="cl-white" value="register">REGISTER</Link></button>
                        </div>
                    </div>
                </div>
            </div>
            </div>
        );
    }
}
export default Singin;
